import { NavWrap, NavItem } from "./Nav.styles";

function Nav(props) {
    const { menu } = props
    console.log(menu);

    return(
        <NavWrap>
            {menu.map(item => {
                <NavItem>{item.title}</NavItem>
            })}
        </NavWrap>
    );
}

export default Nav;
